AVERAGE_CONTRACT_SIZE = 1405
MIN_CONTRACT_SIZE = 6
MAX_CONTRACT_SIZE = 11526

import random

class WeightedRandomizer:
    def __init__ (self, weights):
        self.__max = .0
        self.__weights = []
        for value, weight in weights.items ():
            self.__max += weight
            self.__weights.append ( (self.__max, value) )

    def random (self):
        r = random.random () * self.__max
        for ceil, value in self.__weights:
            if ceil > r:
                return value

#todo: add gauss histogramm random.randgauss(min,max,avg)

def create_random_code():
    length = int(random.triangular(MIN_CONTRACT_SIZE,2*AVERAGE_CONTRACT_SIZE+MIN_CONTRACT_SIZE))  # use gauss

    rnd_prolog = WeightedRandomizer(LIKELYHOOD_PROLOG_BY_OPCODE_INT)
    rnd_epilog = WeightedRandomizer(LIKELYHOOD_EPILOG_BY_OPCODE_INT)
    rnd_corpus = WeightedRandomizer(LIKELYHOOD_BY_OPCODE_INT)

    b = []
    for _ in range(128):
        b.append(rnd_prolog.random())
    for _ in range(length - 128*2):
        b.append(rnd_corpus.random())
    for _ in range(128):
        b.append(rnd_epilog.random())

    return bytes(b)

print(create_random_code())
